import Layout from "../components/Layout";

import Slider from "../components/Slider";
import RecentCard from "../components/blog/Recent";

const Index = () => {
  return (
    <React.Fragment>
    <Layout>
      <Slider />
     <RecentCard/>
    </Layout>
    </React.Fragment>
  );
};

export default Index;
